import React from "react";
//import PropTypes from "prop-types";

const Select = props => {
  return (
    <div>
      <div>Do you wish to start a new board with {props.student.name}?</div>
      <button onClick={props.select}>Yes</button>
      <button onClick={props.cancel}>Cancel</button>
    </div>
  );
};

export default Select;
